import React from "react";
import { Transport } from "tone";

class Trans extends React.Component {
  state = {};

  transporthandler = () => {
    let transport = new Tone.Transport({
      bpm: 120,
      swing: 0,

      timeSignature: 4,
      loopStart: 0,
      loopEnd: "4m",
      PPQ: 192
    });
    console.log("transport", transport);
  };

  render() {
    return (
      <div>
        <button onClick={this.transporthandler} type="button">
          Transport
        </button>
      </div>
    );
  }
}

export default Trans;
